INSERT INTO `paginas` (`id`, `ativo`, `pagina`, `titulo`, `texto`, `info`, `representante`, `foto`, `telefone`, `endereco`, `email`, `horario`, `site`, `facebook`, `instagram`, `twitter`, `localizacao`) VALUES
(1, 1, 'historia', 'História', '<p>Fronteira foi fundada no dia 18 de julho de 1943, ao contrário de outros núcleos urbanos da região, a cidade foi planejada antes de sua construção. Seu idealizador e fundador foi o jornalista, advogado, escritor e poeta, Dr. Maurício Goulart, que contou com uma equipe de colaboradores, também jornalistas e intelectuais, todos de São Paulo. A idéia parece ter surgido após a construção da ponte Mendonça Lima, sobre o Rio Grande, ligando São Paulo a Minas Gerais, e inaugurada em 1943, onde o responsável era o general Miguel Costa. Foi então criada a Companhia Construtora da cidade de Fronteira, da qual participaram pessoas ligadas ao jornalista que se empenharam na execução da obra.</p><p>Segundo consta, o nome Fronteira não foi escolhido em virtude da condição fronteiriça da nova cidade, mas pelos significados que a idéia de se erguer um núcleo em plena selva trazia para seus construtores, isto é de uma nova realidade que se abria em suas vidas.</p><p>Fronteira foi planejada para ser polo de atração turística, e em tudo a natureza colaborou para a realização deste sonho com suas belíssimas cachoeiras: dos Patos, do Marimbondo, das Andorinhas, o Rebojinho, o Ferrador, e uma quantidade enorme de peixes os quais foram inundados pela barragem da represa de Marimbondo.</p><p>A partir da edificação das primeiras casas, foi instalado, em 1945, um centro telefônico, da Companhia de Telefones do Brasil Central e posteriormente, construída a Usina Hidrelétrica de Marimbondo, das Centrais elétricas de Furnas. O núcleo cresceu integrado ao município de Frutal, do qual se desligou em 30 de dezembro de 1962, quando a Lei n.º 2764 criou o município e a cidade. A cidade faz parte da 116º região administrativa contando com um único distrito.</p><p>Gentílico: Fronteirense</p><p>Formação Administrativa</p><p>Elevado á categoria de município e distrito com a denominação de Fronteira, pela Lei estadual nº 2764, de 30-12-1962, desmembrado do município de Frutal. Sede no atual distrito de Fronteira.</p><p>Constituído do distrito sede. Instalado em 01-03-1963.</p><p>Em divisão territorial datada de 31-XII-1963, o município é constituído do distrito sede.</p><p>Assim permanecendo em divisão territorial datada de 2001.</p><p>Pela Lei nº municipal 1161, de 07-05-2004, é criado o distrito de Santo Antônio do Rio Grande e anexado ao município de Fronteira.</p><p>Em divisão territorial datada de 2005, o município é constituído de 2 distritos: Fronteira e Santo Antônio do Rio Grande.</p><p>Assim permanecendo em divisão territorial datada de 2007.</p><p><a href=\"https://www.facebook.com/groups/fronteira.mg.fotosantigas\" target=\"_blank\">Conheça mais clicando aqui...</a></p>', 0, '', '', '', '', '', '', '', '', '', '', ''),
