(8, 1, 'cacs-fundeb', 'CACS FUNDEB', '<div class=\"text-justify margin-top-20\">\r\n                                    <p>O CAS (Conselho de Acompanhamento\r\n Social) e o FUNDEB (Fundo de Manutenção e Desenvolvimento da Educação \r\nBásica e de Valorização dos Profissionais da Educação) são dois órgãos \r\nrelacionados à gestão dos recursos financeiros destinados à educação.</p>\r\n\r\n<p>O FUNDEB é um fundo que tem como objetivo garantir recursos para a \r\nmanutenção e o desenvolvimento da educação básica pública, além de \r\nvalorizar os profissionais da educação. Ele é formado por recursos \r\nprovenientes de impostos e transferências dos governos federal, \r\nestaduais e municipais.</p>\r\n\r\n<p>Já o CAS é um órgão colegiado, composto por representantes da \r\nsociedade civil e do poder público, responsável pelo acompanhamento e \r\nfiscalização da aplicação dos recursos do FUNDEB. Ele tem como objetivo \r\nprincipal garantir a transparência e a efetividade na aplicação dos \r\nrecursos do fundo, bem como promover a participação da comunidade no \r\nprocesso de gestão dos recursos destinados à educação.</p>\r\n                                </div>\r\n                                <div class=\"row margin-top-30\">\r\n                                    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n                                        <p>&nbsp;<strong><span style=\"font-size:12.0pt\"><span style=\"color:black\">MEMBROS TITULARES DO CACSFUNDEB QUADRIÊNIO 2023/2026 </span></span></strong></p>\r\n\r\n<p><span style=\"font-size:12.0pt\"><span style=\"color:#3498db\"><strong>PRESIDENTE</strong>: </span>Edionéia Irene de Lima Silva&nbsp;</span><br>\r\n<span style=\"font-size:12.0pt\"><span style=\"color:#3498db\"><strong>VICE -PRESIDENTE:</strong> </span>Bruna Figueiredo&nbsp;</span></p>\r\n\r\n<p><u><span style=\"font-size:12.0pt\">CONSELHEIROS:</span></u></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE PODER EXECUTIVO MUNICIPAL</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Geissimara Buzini&nbsp;<br>\r\nVanessa Coromi Basilio IL Morales Galdino</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS PROFESSORES DA EDUCAÇÃO BÁSICA PÚBLICA</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Glauciane de Souza Costa Miziara&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS DIRETORES DA EDUCAÇÃO BÁSICA PÚBLICA </span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Edilaine Fernandes de Freitas&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS SERVIDORES TÉCNICOS ADMINISTRATIVOS DA EDUCAÇÃO BÁSICA PÚBLICA</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Micaela Cardoso Silva </span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS </span><span style=\"font-size:12.0pt\"><span style=\"background-color:white\">PAIS DE ALUNOS DA EDUCAÇÃO BÁSICA PÚBLICA</span></span><span style=\"font-size:12.0pt\">.</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Edionéia Irene de Lima Silva&nbsp;</span><br>\r\n<span style=\"font-size:12.0pt\">Sandra Rodrigues de Sá Rosa&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS ESTUDANTES DA EDUCAÇÃO BÁSICA PÚBICA</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Evani José Pedroso&nbsp;&nbsp;</span><br>\r\n<span style=\"font-size:12.0pt\">João Alves Nunes&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DO CONSELHO MUNICIPAL DE EDUCAÇÃO</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Bruna Figueiredo&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DO CONSELHO TUTELAR </span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Eunice Lima Silva de Oliveira&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DAS ORGANIZAÇÕES DA SOCIEDADE CIVIL</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Elieser Cesário da Silva&nbsp;<br>\r\nReginaldo Luiz de Oliveira</span></p></div></div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(9, 1, 'cmas', 'CMAS', '<div class=\"text-justify margin-top-20\">\r\n                                    <p>Conselho Municipal de Assistência\r\n Social. O CMAS é um conselho de caráter deliberativo e de controle \r\nsocial, responsável por formular e acompanhar a execução da política de \r\nassistência social em âmbito municipal. Ele é composto por \r\nrepresentantes do governo e da sociedade civil, incluindo usuários ou \r\nbeneficiários dos serviços de assistência social, trabalhadores da área,\r\n entidades e organizações da sociedade civil.</p>\r\n\r\n<p>Entre as suas atribuições, destacam-se a aprovação do Plano Municipal\r\n de Assistência Social, a fiscalização da gestão dos recursos e ações da\r\n política de assistência social, a deliberação sobre o financiamento e a\r\n aprovação de projetos e programas, a proposição de normas \r\ncomplementares para a execução da política de assistência social, entre \r\noutras atividades.</p>\r\n\r\n<p>O CMAS é um importante espaço de participação social e de \r\nfortalecimento da democracia, tendo em vista que representa a voz da \r\nsociedade na formulação e acompanhamento das políticas públicas de \r\nassistência social. Ele contribui para garantir a efetividade dos \r\ndireitos sociais e a proteção social de indivíduos e famílias em \r\nsituação de vulnerabilidade e risco social.</p>\r\n                                </div>\r\n                                <div class=\"row margin-top-30\">\r\n                                    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n                                        <p>&nbsp;<strong>MEMBROS TITULARES DO CMAS BIÊNIO 2022/2024</strong></p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>PRESIDENTE</strong>:</span>&nbsp;Miria Santana Nogueira<br>\r\n<span style=\"color:#3498db\"><strong>VICE -PRESIDENTE:</strong>&nbsp;</span>Ilza Aparecida da Silva&nbsp;</p>\r\n\r\n<p><span style=\"color:#95a5a6\"><u>CONSELHEIROS:</u></span></p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>REPRESENTANTE DA ASSISTÊNCIA SOCIAL</strong>:</span>&nbsp;<br>\r\nEvellyn Trindade de Castro Martins Ferreira<br>\r\nRebeca Miranda dos Santos</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>REPRESENTANTE DA EDUCAÇÃO</strong>:</span>&nbsp;<br>\r\nPaula Feres da Silva&nbsp;<br>\r\nLuany Jerônimo de Oliveira</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>REPRESENTANTE DA SAÚDE</strong>:</span>&nbsp;<br>\r\nAdriana Elias Gaioso Ferreira<br>\r\nCarolina Nunes Coelho</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>REPRESENTANTE DA ENTIDADE</strong>:</span>&nbsp;<br>\r\nIlza Aparecida Silva&nbsp;<br>\r\nNilza da Silva Mendonça</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>REPRESENTANTE DOS USUÁRIOS</strong>:</span>&nbsp;<br>\r\nAline Cristina da Silva<br>\r\nTatiana Mary de Oliveira Souza</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>REPRESENTANTE DOS TRABALHADORES DO SUAS</strong>:</span>&nbsp;<br>\r\nMiria Santana Nogueira<br>\r\nLuci Mara Eufrazio Floriano Ismael</p>\r\n                                    </div>\r\n                                </div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(10, 1, 'cmdca', 'CMDCA', '<div class=\"text-justify margin-top-20\">\r\n                                    <p>O CMDCA é um conselho composto \r\npor representantes da sociedade civil e do poder público, responsável \r\npor formular e acompanhar as políticas públicas voltadas para a \r\npromoção, proteção e defesa dos direitos das crianças e adolescentes em \r\nâmbito municipal. Entre as suas atribuições, destacam-se a elaboração do\r\n Plano Municipal dos Direitos da Criança e do Adolescente, a \r\nfiscalização das políticas e ações voltadas para essa população, a \r\naprovação de projetos financiados com recursos do Fundo Municipal dos \r\nDireitos da Criança e do Adolescente, além de outras atividades \r\nrelacionadas à garantia dos direitos dessa parcela da população. O CMDCA\r\n é um importante instrumento de participação social e de fortalecimento \r\nda democracia, tendo em vista que representa a voz da sociedade na \r\nformulação e acompanhamento das políticas públicas voltadas para as \r\ncrianças e adolescentes.</p>\r\n                                </div>\r\n                                <div class=\"row margin-top-30\">\r\n                                    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n                                        <p>&nbsp;<strong>MEMBROS TITULARES DO CMDCA GESTÃO: 27/03/2023 À 23/08/2024</strong></p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>PRESIDENTE</strong>:</span>&nbsp;Neif Chala<br>\r\n<span style=\"color:#3498db\"><strong>VICE -PRESIDENTE:</strong></span>&nbsp;Paulo Cesar Machado Alves</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>PRIMEIRO SECRETÁRIO:&nbsp;</strong></span>Adalberto Luciano de Lima<br>\r\n<span style=\"color:#3498db\"><strong>SEGUNDO&nbsp;SECRETÁRIO:&nbsp;</strong></span>Juliana Rodrigues de Andrade</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>PRIMEIRO TESOUREIRO: </strong></span>Reginaldo Luiz de Oliveira&nbsp;<br>\r\n<strong>SEGUNDO&nbsp;TEOUREIRO: </strong>Fabricio Angelino Filipe&nbsp;</p>\r\n\r\n<p><span style=\"color:#3498db\"><strong>ACESSOR JURÍDICO: </strong></span>Doutor Ricardo Boelho Fonseca</p></div></div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(11, 1, 'conselho-municipal-de-educacao', 'CONSELHO MUNICIPAL DE EDUCAÇÃO', '<div class=\"text-justify margin-top-20\">\r\n    <p style=\"text-align:justify\">Conselho\r\n        Municipal de Educação é responsável por assessorar o poder executivo na\r\n        formulação, implantação e avaliação da política educacional do\r\n        município. Ele é composto por representantes da sociedade civil e do\r\n        poder público, e tem como objetivo promover o debate sobre questões\r\n        educacionais, propor políticas públicas, acompanhar a execução das ações\r\n        educacionais e zelar pela qualidade da educação oferecida à população.\r\n        Além disso, o Conselho Municipal de Educação é responsável por\r\n        estabelecer normas e diretrizes para o sistema educacional do município,\r\n        bem como deliberar sobre assuntos relacionados à educação, como a\r\n        criação ou alteração de escolas, a contratação de professores e a\r\n        definição de currículos escolares.</p>\r\n</div>\r\n<div class=\"row margin-top-30\">\r\n    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n        <p><span style=\"font-size:16px\"><span style=\"color:#3498db\"><strong>PRESIDENTE DO CONSELHO MUNICIPAL DA EDUCAÇÃO (CME):&nbsp;</strong></span></span><br>\r\n            <span style=\"font-size:16px\"><strong>Carla Peixoto</strong></span>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DO PODER CÂMARA MUNICIPAL:</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Karen Cristina Medina Moura</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE SECRETARIA MUNICIPAL DE EDUCAÇÃO:</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Rejeane Aparecida Lopes de Souza e Paula</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DOS PROFESSORES DA EDUCAÇÃO BÁSICA PÚBLICA:</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Váleria Garcia</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DOS DIRETORES DAS ESCOLAS BÁSICAS PÚBLICAS:</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Juliana Rodrigues de Andrade</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTES DOS PAIS DE ALUNOS DE EDUCAÇÃO BÁSICA PÚBLICA:</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Edionéia Irene de Lime Silva&nbsp;&nbsp;</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DAS ESCOLAS DO ESTADO</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Cristiane Souza Silva</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DO CONSELHO TUTELAR: </span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Eunice Lima Silva Oliveira</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE ORGANIZAÇÃO DA SOCIEDADE CIVIL</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Elieser Cesário da Silva&nbsp; &nbsp;</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DE INSTITUIÇÃO FILANTRÓPICA</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Maria Inês Ramos&nbsp;&nbsp;</span></strong>\r\n        </p>\r\n\r\n        <p><span style=\"color:#3498db\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DE ESPECIALISTA DE EDUCAÇÃO BÁSICA PUBLICA</span></strong></span><br>\r\n            <strong><span style=\"font-size:12.0pt\">Edina Carraro Marques</span></strong>\r\n        </p>\r\n    </div>\r\n\r\n    \r\n</div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(12, 1, 'comtur', 'COMTUR', '<h2>CONSELHO MUNICIPAL DE TURISMO – COMTUR E FUNDO MUNICIPAL DE TURISMO - FUMTUR DE FRONTEIRA/MG</h2>\r\n                                <div class=\"text-justify margin-top-20\">\r\n                                    <p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">O\r\n COMTUR, dada a sua característica de Conselho Municipal, é uma \r\ninstância de planejamento participativo nas gestões locais, sendo \r\nconstituído como um fórum deliberativo no tema turismo. É um órgão da \r\nAdministração Municipal, ligado ao poder executivo, de caráter \r\nconsultivo e/ou deliberativo, composto por representantes do poder \r\npúblico, empresários e sociedade civil.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Este órgão é\r\n capaz de promover a descentralização administrativa, constituindo um \r\nespaço de vivência e de construção contínua da democracia, essencial \r\npara uma gestão participativa. Neste sentido, os conselhos permitem que a\r\n comunidade contribua, participe e fiscalize as ações do governo de \r\nforma legítima.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"background-color:white\"><strong><span style=\"font-size:12.0pt\"><span style=\"color:black\">MISSÃO DO COMTUR</span></span></strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"background-color:white\"><span style=\"font-size:12.0pt\"><span style=\"color:black\">Consolidar\r\n parcerias e proporcionar, através de suas ações, o envolvimento e o \r\ncomprometimento dos mais variados setores socioeconômicos do município \r\nno fomento da atividade turística.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\"><span style=\"background-color:white\"><span style=\"color:black\">FUNÇÃO DO COMTUR</span></span></span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Auxiliar \r\nna formulação e implantação da Política Municipal de Turismo, observando\r\n o Plano Diretor e as demais legislações relacionadas à atividade \r\nturística no município; </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Auxiliar a\r\n Secretaria Municipal de Turismo ou órgão equivalente no planejamento e \r\nexecução de ações, planos, programas e projetos, deliberando sobre sua \r\nimportância para definir prioridades; </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Zelar \r\npara que o desenvolvimento da atividade turística no município se faça \r\nsob a defesa da ética e da sustentabilidade ambiental, social, cultural,\r\n econômica e política, propondo normas que contribuam com a produção e \r\nadequação da legislação turística, tendo por objetivo a qualidade do \r\nturismo municipal; </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Fornecer,\r\n quando solicitados, auxílio e informações ao Poder Público e à \r\ncomunidade, quanto aos programas e projetos que visem à melhoria da \r\nprática da atividade turística no município;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Adotar \r\nmedidas e apoiar iniciativas em favor do desenvolvimento do turismo e \r\natividades próximas, objetivando a saúde e o bem-estar do cidadão, \r\nobservando o cumprimento dos princípios e normas legais;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Orientar e fiscalizar o gerenciamento do investimento na atividade turística;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Gerenciar o Fundo Municipal de Turismo;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Acompanhar a gestão de recursos \r\npúblicos voltados para a prática do turismo, bem como avaliar os ganhos \r\nsociais obtidos e o desempenho dos&nbsp;&nbsp; e projetos aprovados, \r\nmanifestando-se a respeito e sugerindo aprimoramento;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Coordenar, incentivar e promover o Turismo no município;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Propor à Administração Municipal e à\r\n sociedade civil medidas de difusão e amparo ao Turismo em colaboração \r\ncom órgãos e entidades oficiais especializadas;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Promover a articulação de toda a \r\nsociedade através de campanhas que propiciem a transformação de cada \r\ncidadão em agente da imagem turística e defensor do patrimônio cultural e\r\n ambiental do município;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Estimular as atividades culturais e turísticas no município.</span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">FUNDO MUNICIPAL DE TURISMO - FUMTUR</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">O FUMTUR - \r\nFundo Municipal de Turismo é uma conta bancária exclusiva, vinculada à \r\nadministração financeira da Prefeitura, destinada a receber recursos, \r\npróprios ou de terceiros, a serem investidos no desenvolvimento das \r\nações previstas na Lei da Política Municipal de Turismo e no Plano \r\nMunicipal de Turismo. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Gerenciado \r\npelo COMTUR, o FUMTUR apresenta autonomia na utilização dos recursos, \r\nmas dependência política e contábil da prefeitura municipal. Ou seja, os\r\n recursos do FUMTUR deverão ser destinados para a execução das ações \r\npropostas na Lei da Política Municipal de Turismo e no Plano Municipal \r\nde Turismo, estando os custos para manutenção administrativa da \r\nsecretaria de turismo desvinculados deste recurso.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">O COMTUR, \r\ndada a sua característica de Conselho Municipal, é uma instância de \r\nplanejamento participativo nas gestões locais, sendo constituído como um\r\n fórum deliberativo no tema turismo. É um órgão da Administração \r\nMunicipal, ligado ao poder executivo, de caráter consultivo e/ou \r\ndeliberativo, composto por representantes do poder público, empresários e\r\n sociedade civil.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Este órgão é\r\n capaz de promover a descentralização administrativa, constituindo um \r\nespaço de vivência e de construção contínua da democracia, essencial \r\npara uma gestão participativa. Neste sentido, os conselhos permitem que a\r\n comunidade contribua, participe e fiscalize as ações do governo de \r\nforma legítima.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"background-color:white\"><strong><span style=\"font-size:12.0pt\"><span style=\"color:black\">MISSÃO DO COMTUR</span></span></strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"background-color:white\"><span style=\"font-size:12.0pt\"><span style=\"color:black\">Consolidar\r\n parcerias e proporcionar, através de suas ações, o envolvimento e o \r\ncomprometimento dos mais variados setores socioeconômicos do município \r\nno fomento da atividade turística.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\"><span style=\"background-color:white\"><span style=\"color:black\">FUNÇÃO DO COMTUR</span></span></span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Auxiliar \r\nna formulação e implantação da Política Municipal de Turismo, observando\r\n o Plano Diretor e as demais legislações relacionadas à atividade \r\nturística no município; </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Auxiliar a\r\n Secretaria Municipal de Turismo ou órgão equivalente no planejamento e \r\nexecução de ações, planos, programas e projetos, deliberando sobre sua \r\nimportância para definir prioridades; </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Zelar \r\npara que o desenvolvimento da atividade turística no município se faça \r\nsob a defesa da ética e da sustentabilidade ambiental, social, cultural,\r\n econômica e política, propondo normas que contribuam com a produção e \r\nadequação da legislação turística, tendo por objetivo a qualidade do \r\nturismo municipal; </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Fornecer,\r\n quando solicitados, auxílio e informações ao Poder Público e à \r\ncomunidade, quanto aos programas e projetos que visem à melhoria da \r\nprática da atividade turística no município;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Adotar \r\nmedidas e apoiar iniciativas em favor do desenvolvimento do turismo e \r\natividades próximas, objetivando a saúde e o bem-estar do cidadão, \r\nobservando o cumprimento dos princípios e normas legais;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Orientar e fiscalizar o gerenciamento do investimento na atividade turística;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Gerenciar o Fundo Municipal de Turismo;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Acompanhar a gestão de recursos \r\npúblicos voltados para a prática do turismo, bem como avaliar os ganhos \r\nsociais obtidos e o desempenho dos&nbsp;&nbsp; e projetos aprovados, \r\nmanifestando-se a respeito e sugerindo aprimoramento;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Coordenar, incentivar e promover o Turismo no município;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Propor à Administração Municipal e à\r\n sociedade civil medidas de difusão e amparo ao Turismo em colaboração \r\ncom órgãos e entidades oficiais especializadas;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Promover a articulação de toda a \r\nsociedade através de campanhas que propiciem a transformação de cada \r\ncidadão em agente da imagem turística e defensor do patrimônio cultural e\r\n ambiental do município;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Estimular as atividades culturais e turísticas no município.</span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">FUNDO MUNICIPAL DE TURISMO - FUMTUR</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">O FUMTUR - \r\nFundo Municipal de Turismo é uma conta bancária exclusiva, vinculada à \r\nadministração financeira da Prefeitura, destinada a receber recursos, \r\npróprios ou de terceiros, a serem investidos no desenvolvimento das \r\nações previstas na Lei da Política Municipal de Turismo e no Plano \r\nMunicipal de Turismo. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\">Gerenciado \r\npelo COMTUR, o FUMTUR apresenta autonomia na utilização dos recursos, \r\nmas dependência política e contábil da prefeitura municipal. Ou seja, os\r\n recursos do FUMTUR deverão ser destinados para a execução das ações \r\npropostas na Lei da Política Municipal de Turismo e no Plano Municipal \r\nde Turismo, estando os custos para manutenção administrativa da \r\nsecretaria de turismo desvinculados deste recurso.</span></p>\r\n                                </div>\r\n                                <div class=\"row margin-top-30\">\r\n                                    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n                                        <p><strong><span style=\"font-size:12.0pt\">REPRESENTANTES DA SECRETARIA MUNICIPAL DE GOVERNO E DESENVOLVIMENTO ECONÔMICO.</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">PRESIDENTE:</span></strong></span> <span style=\"font-size:12.0pt\">Dilvaci Rodrigues Nascimento;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">VICE PRESIDENTE: </span></span></strong><span style=\"font-size:12.0pt\">Lusandra Rodrigues das Neves Barboza;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">SECRETARIA:</span></strong></span><span style=\"font-size:12.0pt\">Cristina de Cassia Prado Oliveira;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">VICE SECRETARIA:</span></span></strong><span style=\"font-size:12.0pt\"> Rosangela Aparecida de Oliveira; </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TESOUREIRA:</span></strong></span><span style=\"font-size:12.0pt\">Claudia Cristina da Silveira Pires.</span></p>\r\n\r\n<p><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DA SECRETARIA MUNICIPAL DE OBRAS E SERVIÇOS URBANOS;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR: </span></strong></span><span style=\"font-size:12.0pt\">Cristina de Cassia Prado Oliveira;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE: </span></span></strong><span style=\"font-size:12.0pt\">Vago</span></p>\r\n\r\n<p><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DA SECRETARIA MUNICIPAL DE CULTURA ESPORTE E LAZER;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR: </span></strong></span><span style=\"font-size:12.0pt\">Luiz Fernando Pineis;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE: </span></span></strong><span style=\"font-size:12.0pt\">Micaele Mendes Pereira Cotrim;</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DA SECRETARIA MUNICIPAL DE EDUCAÇÃO;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">TITULAR:</span> </span></strong><span style=\"font-size:12.0pt\">Paula Feres Silva;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE: </span></span></strong><span style=\"font-size:12.0pt\">Carla Peixoto; </span></p>\r\n\r\n<p><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DA SECRETARIA MUNICIPAL DE ADMINISTRAÇÃO, PLANEJAMENTO E FINANÇAS;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\"> Rosa Elaine de Paula Ribeiro;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\">Vago</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DO SETOR DE HOTELARIA E SIMILARES;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\">Janete Amélia Alves Hussain;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\">Joaquim Candido da Silva;</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DO SETOR GASTRONÖMICO, BARES E SIMILARES;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\"> Jose Luiz Gomes Júnior;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\"> Dilvaci Rodrigues Nascimento;</span></p>\r\n\r\n<p><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DO SETOR DE EVENTOS/ATRAÇÕES TURÍSTICAS E ASSOCIAÇAO DE ARTESÃOS;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\">Mariana Caetano Fernandes;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\">Josineide Morais da Silva Bento; </span></p>\r\n\r\n<p><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DOS CONDOMÍNIOS E EMPREENDIMENTOS IMOBILIÁRIOS;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\">Augustinho Edisson da Silva;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\">Márcio Rogério da Costa;</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DA POLÍCIA MILITAR DO ESTADO DE MINAS GERAIS;</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\">Ademir Barbosa da Silva;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\">Geneide Morais da Silva;</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:12.0pt\">REPRESENTANTE DO SETOR DO COMÉRCIO VAREJISTA DE ALIMENTOS E BEBIDAS.</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-size:12.0pt\">TITULAR:</span></strong></span><span style=\"font-size:12.0pt\">Adalberto Luciano de Lima;</span><br>\r\n<strong><span style=\"font-size:12.0pt\"><span style=\"color:#2980b9\">SUPLENTE:</span></span></strong><span style=\"font-size:12.0pt\"> Wendel Ferreira Vilela;</span></p></div></div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(13, 1, 'conselho-tutelar', 'Conselho Tutelar', '<div class=\"col-lg-8 col-md-8 col-sm-8 col-xs-12\">\r\n                                <h2>CONSELHO TUTELAR DO DIREITOS DA CRIANÇA E DO ADOLESCENTE DE FRONTEIRA - MG</h2>\r\n                                <div class=\"text-justify margin-top-20\">\r\n                                    <p>O Conselho Tutelar é um órgão \r\nresponsável por zelar pelos direitos das crianças e dos adolescentes, \r\ngarantindo sua proteção e bem-estar. Ele é composto por cinco membros \r\neleitos pela comunidade local, para um mandato de quatro anos, e atua de\r\n forma autônoma, ou seja, sem subordinação a qualquer outro órgão do \r\ngoverno.</p>\r\n\r\n<p>Dentre as principais atribuições do Conselho Tutelar, podemos destacar:</p>\r\n\r\n<ul>\r\n	<li>Receber e atender denúncias de violação dos direitos da criança e do adolescente, encaminhando-as para os órgãos competentes;</li>\r\n	<li>Atender crianças e adolescentes em situação de risco pessoal ou social;</li>\r\n	<li>Fiscalizar entidades que abrigam crianças e adolescentes, como abrigos e casas de acolhimento;</li>\r\n	<li>Acompanhar o processo de adoção de crianças e adolescentes;</li>\r\n	<li>Aplicar medidas de proteção, como encaminhamento para programas de \r\nassistência social, orientação, apoio e acompanhamento temporário em \r\nmeio familiar substituto;</li>\r\n	<li>Aplicar medidas de advertência aos pais ou responsáveis que praticarem atos contrários aos direitos da criança e do adolescente;</li>\r\n	<li>Representar junto à autoridade judiciária nos casos de descumprimento injustificado de suas deliberações.</li>\r\n</ul>\r\n\r\n<p>O Conselho Tutelar é um órgão muito importante para a proteção e \r\ngarantia dos direitos das crianças e dos adolescentes, e deve ser \r\nacionado sempre que houver suspeita ou constatação de violação desses \r\ndireitos.</p>\r\n                                </div>\r\n                                <div class=\"row margin-top-30\">\r\n                                    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n                                        <p><span style=\"color:#000099\"><span style=\"font-size:18px\">Conselhereiras Tutelares Atuantes:</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\">Amanda Cristina de Souza Silva&nbsp;<br>\r\nAnielle Garcez Silva Nunes<br>\r\nEunice Lima da Silva Oliveira<br>\r\nGrazielle Cristina Pereira Lau de Souza<br>\r\nNaiara dos Santos Neves</span></p>\r\n                                    </div>\r\n                                </div>\r\n\r\n                                                            </div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(14, 1, 'cae', 'CAE', '<h2>CONSELHOR DE ALIMENTAÇÃO ESCOLAR</h2>\r\n                                <div class=\"text-justify margin-top-20\">\r\n                                    <p>O Conselho de Alimentação Escolar\r\n (CAE) é um órgão colegiado, de caráter fiscalizador, deliberativo e de \r\nassessoramento, responsável pelo acompanhamento e controle social dos \r\nrecursos federais destinados à alimentação escolar. Ele tem como \r\nobjetivo principal garantir que os recursos repassados pelo Governo \r\nFederal sejam utilizados de forma adequada na alimentação escolar, \r\npromovendo uma alimentação saudável e de qualidade para os estudantes \r\ndas escolas públicas.</p>\r\n\r\n<p>Entre as principais atribuições do CAE, podemos destacar:</p>\r\n\r\n<ul>\r\n	<li>Acompanhar e fiscalizar a aplicação dos recursos federais destinados à alimentação escolar;</li>\r\n	<li>Verificar a qualidade dos alimentos adquiridos e servidos nas escolas, bem como a adequação nutricional das refeições;</li>\r\n	<li>Orientar e estimular a participação da comunidade escolar no \r\nplanejamento, execução, acompanhamento e controle da alimentação \r\nescolar;</li>\r\n	<li>Promover ações de educação alimentar e nutricional para os \r\nestudantes, professores e demais envolvidos no processo de alimentação \r\nescolar;</li>\r\n	<li>Elaborar relatórios e pareceres sobre a execução do Programa \r\nNacional de Alimentação Escolar (PNAE) no município, que devem ser \r\nencaminhados aos órgãos competentes.</li>\r\n</ul>\r\n\r\n<p>O CAE é um órgão muito importante para garantir a qualidade da \r\nalimentação escolar, promover hábitos alimentares saudáveis e estimular a\r\n participação da comunidade escolar na gestão da alimentação escolar. \r\nSua atuação é fundamental para o bom funcionamento do Programa Nacional \r\nde Alimentação Escolar e para a promoção da educação de qualidade.</p>\r\n                                </div>\r\n                                <div class=\"row margin-top-30\">\r\n                                    <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 composicao\">\r\n                                        <p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DO PODER EXECUTIVO</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">João Batista&nbsp;Martins Junior&nbsp;</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS PROFESSORES</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Natália Leocadia de Oliveira</span><br>\r\n<span style=\"font-size:12.0pt\">Nilzareth Aparecida de Camargo</span></p>\r\n\r\n<p><strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DOS PAIS DE ALUNOS</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Bruna Resende dos Santos</span><br>\r\n<span style=\"font-size:12.0pt\">Nathalia Paiva Pettinelle</span><br>\r\n<br>\r\n<strong><span style=\"color:#3498db\"><span style=\"font-size:12.0pt\">REPRESENTANTE DA SOCIEDADE CIVIL</span></span></strong><br>\r\n<span style=\"font-size:12.0pt\">Joaquim Candido da Silva<br>\r\nOeder Pedro Ferreira</span></p></div></div>', 0, '', '', '', '', '', '', '', '', '', '', ''),
(15, 1, 'legislacao-da-transparencia', 'Legislação da Transparência', '<p><a href=\"http://www.planalto.gov.br/ccivil_03/_ato2011-2014/2011/lei/l12527.htm\" target=\"_blank\">A Lei 12.527,</a>,\r\n sancionada em 18 de novembro de 2011, regulamenta o direito \r\nconstitucional de acesso dos cidadãos às informações públicas e é \r\naplicável aos três poderes da União, dos estados, do Distrito Federal e \r\ndos municípios. O Acesso a informação contribui para aumentar a \r\neficiência do Poder Público, diminuir a corrupção e elevar a \r\nparticipação social. Acesso à informação: direito do cidadão e dever do \r\nEstado.<br>\r\n<br>\r\n<a href=\"http://www.planalto.gov.br/ccivil_03/_ato2011-2014/2012/decreto/d7724.htm\" target=\"_blank\">Decreto No 7.724, de 16 de maio de 2012 - Regulamenta a Lei No 12.527, de 18 de novembro de 2011.</a><br>\r\n<br>\r\n<a href=\"https://www.almg.gov.br/consulte/legislacao/completa/completa.html?tipo=DEC&amp;num=45969&amp;ano=2012\" target=\"_blank\">Decreto Estadual No 45.969/2012</a><br>\r\n<br>\r\n<a href=\"http://www.transparencia.mg.gov.br/\" target=\"_blank\">Portal da Transparência do Estado de Minas Gerais.</a><br>\r\n<br>\r\n<a href=\"http://www.portaltransparencia.gov.br/\" target=\"_blank\">Portal da Transparência Federal.</a><br>\r\n<br>\r\n<a href=\"http://fiscalizandocomtce.tce.mg.gov.br/Home/Index\" target=\"_blank\">Minas Transparente - Fiscalizando com o Tribunal de Contas do Estado de Minas Gerais - TCE/MG</a></p>', 0, '', '', '', '', '', '', '', '', '', '', ''),
