(6, 0, 'pat-posto-de-atendimento-ao-trabalhador', 'pat-posto-de-atendimento-ao-trabalhador', 'PAT - Posto de Atendimento ao Trabalhador', '<p>Os candidatos interessados em vagas dever&atilde;o comparecer pessoalmente ao PAT, para a realiza&ccedil;&atilde;o de cadastro no sistema do Governo Federal.</p>\r\n<p>O PAT n&atilde;o realiza a capta&ccedil;&atilde;o de curr&iacute;culos, somente faz cadastros inserindo as informa&ccedil;&otilde;es diretamente no sistema.</p>\r\n<hr>\r\n<h3>VAGAS DISPON&Iacute;VEIS NO POSTO DE ATENDIMENTO AO TRABALHADOR</h3>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><em>*</em><em>As vagas est&atilde;o sujeitas a altera&ccedil;&atilde;o.</em></strong></span><br><span style=\"font-size: 10pt;\"><em>Para mais informa&ccedil;&otilde;es, procure o Posto de Atendimento ao Trabalhador de Amargosa,na Casa do Cidad&atilde;o, localizada no Mercado Municipal, Rua Rangel Pestana, s/n - Centro<br></em><em>Informa&ccedil;&otilde;es: 3815-8805</em></span></p>'),
