(24, 0, 'cemiterios', 'cemiterios', 'Cemitérios', '<p style=\"text-align: center;\"><a class=\"simple-button-plugin\" style=\"display: inline-block; background-color: rgb(42, 128, 185); border: 1px solid rgb(42, 128, 185); padding: 15px 100px; border-radius: 5px; font-size: 22px; cursor: pointer; color: rgb(255, 255, 255) !important; text-decoration: none !important;\" href=\"https://amargosa.portalservicos.app.br:2053/sepultamento?menuID=61\" target=\"_blank\" rel=\"noopener\">Consulta Falecido</a></p>'),
