(27, 0, 'cadastro-ciptea', 'cadastro-ciptea', 'Cadastro CIPTEA', '<h3>ORIENTA&Ccedil;&Otilde;ES</h3>\r\n<p>Este formul&aacute;rio &eacute; destinado para emiss&atilde;o de Carteirinha de Atendimento Priorit&aacute;rio a usu&aacute;rios com transtorno do espectro autista (TEA).<br>A Carteira de Identifica&ccedil;&atilde;o da Pessoa com Transtorno do espectro autista (CIPTEA) foi institu&iacute;da em Amargosa a partir do Decreto 12.719 de 13 de outubro de 2022.<br>Preencha o formul&aacute;rio abaixo para inscrever a pessoa para a aquisi&ccedil;&atilde;o da CIPTEA.<br>Todos os campos s&atilde;o de preenchimento obrigat&oacute;rio (*) e eles devem ser preenchidos corretamente e com informa&ccedil;&otilde;es fidedignas.</p>\r\n<h3>ATEN&Ccedil;&Atilde;O:</h3>\r\n<p>⇨ O formul&aacute;rio s&oacute; poder&aacute; ser enviado quando todos os campos forem corretamente preenchidos. A falta de informa&ccedil;&atilde;o n&atilde;o permite o envio do mesmo.<br><span style=\"color: #000000; font-size: 24px;\">⇨ </span>&Eacute; recomendado o preenchimento completo do formul&aacute;rio em uma &uacute;nica etapa, para que, seja evitada a perda dos dados j&aacute; digitados no caso de qualquer ocorr&ecirc;ncia com o navegador.</p>\r\n<p>Ao finalizar o preenchimento do formul&aacute;rio e clicar em ENVIAR, voc&ecirc; visualizar&aacute; na tela do seu dispositivo a confirma&ccedil;&atilde;o do seu cadastramento e o n&uacute;mero do seu cadastro.<br>Feito o cadastro, aguarde o contato por parte da Prefeitura, atrav&eacute;s da Assessoria de Pol&iacute;ticas de Inclus&atilde;o, para a retirada do documento. O prazo de an&aacute;lise e resposta &eacute; de 3 dias &uacute;teis. E a entrega ser&aacute; feita ap&oacute;s 15 dias da confirma&ccedil;&atilde;o da an&aacute;lise.<br><br>Em caso de d&uacute;vida, entre em contato com Assessoria de Pol&iacute;ticas de Inclus&atilde;o: (14) 3811-1522 ou 3811-1521.<br><br>Caso o requente tenha dificuldade em preencher o formul&aacute;rio, entrar em contato pelo telefone: 3811-1522 de segunda a sexta-feira, das 8 &agrave;s 16:30h.</p>\r\n<h3>Sobre LGPD</h3>\r\n<p>As informa&ccedil;&otilde;es coletadas est&atilde;o de acordo com a Lei Federal 13.709, no seu Artigo 7&ordm;, incisos II e III (Lei Geral de Prote&ccedil;&atilde;o de Dados).<br>Todos os campos s&atilde;o coletados para elabora&ccedil;&atilde;o da Carteira de Identifica&ccedil;&atilde;o da Pessoa com Transtorno do espectro autista (CIPTEA), com base no Decreto 12.719 de 13 de outubro de 2022.</p>'),
