(37, 0, 'coronavirus', 'coronavirus', 'Coronavírus', '<h3>O que &eacute; COVID-19</h3>\r\n<p>Os coronav&iacute;rus s&atilde;o uma grande fam&iacute;lia de v&iacute;rus comuns em muitas esp&eacute;cies diferentes de animais, incluindo camelos, gado, gatos e morcegos. Raramente, os coronav&iacute;rus que infectam animais podem infectar pessoas, como exemplo do MERS-CoV e SARS-CoV. Recentemente, em dezembro de 2019, houve a transmiss&atilde;o de um novo coronav&iacute;rus (SARS-CoV-2), o qual foi identificado em Wuhan na China e causou a COVID-19, sendo em seguida disseminada e transmitida pessoa a pessoa.</p>\r\n<p>A COVID-19 &eacute; uma doen&ccedil;a causada pelo coronav&iacute;rus, denominado SARS-CoV-2, que apresenta um espectro cl&iacute;nico variando de infec&ccedil;&otilde;es assintom&aacute;ticas a quadros graves. De acordo com a Organiza&ccedil;&atilde;o Mundial de Sa&uacute;de, a maioria (cerca de 80%) dos pacientes com COVID-19 podem ser assintom&aacute;ticos ou oligossintom&aacute;ticos (poucos sintomas), e aproximadamente 20% dos casos detectados requer atendimento hospitalar por apresentarem dificuldade respirat&oacute;ria, dos quais aproximadamente 5% podem necessitar de suporte ventilat&oacute;rio.</p>'),
(38, 0, 'dengue', 'dengue', 'Dengue', '<h3>O que &eacute; dengue?</h3>\r\n<p>Dengue &eacute; uma doen&ccedil;a febril grave causada por um arbov&iacute;rus. Arbov&iacute;rus s&atilde;o v&iacute;rus transmitidos por picadas de insetos, especialmente os mosquitos. Existem quatro tipos de v&iacute;rus de dengue (sorotipos 1, 2, 3 e 4). Cada pessoa pode ter os 4 sorotipos da doen&ccedil;a, mas a infec&ccedil;&atilde;o por um sorotipo gera imunidade permanente para ele.</p>\r\n<p>O transmissor (vetor) da dengue &eacute; o mosquito Aedes aegypti, que precisa de &aacute;gua parada para se proliferar. O per&iacute;odo do ano com maior transmiss&atilde;o s&atilde;o os meses mais chuvosos de cada regi&atilde;o, mas &eacute; importante manter a higiene e evitar &aacute;gua parada todos os dias, porque os ovos do mosquito podem sobreviver por um ano at&eacute; encontrar as melhores condi&ccedil;&otilde;es para se desenvolver.</p>\r\n<p>Todas as faixas et&aacute;rias s&atilde;o igualmente suscet&iacute;veis, por&eacute;m as pessoas mais velhas t&ecirc;m maior risco de desenvolver dengue grave e outras complica&ccedil;&otilde;es que podem levar &agrave; morte. O risco de gravidade e morte aumenta quando a pessoa tem alguma doen&ccedil;a cr&ocirc;nica, como diabetes e hipertens&atilde;o, mesmo tratada.</p>'),
(39, 0, 'vacinometro', 'vacinometro', 'Vacinômetro', '<h3>GUIA DE VACINA&Ccedil;&Atilde;O E PREVEN&Ccedil;&Atilde;O SOBRE O CORONAV&Iacute;RUS</h3>\r\n<p>Vacinar &eacute; salvar vidas.</p>\r\n<h3>Situa&ccedil;&atilde;o atual da vacina&ccedil;&atilde;o em nossa cidade</h3>\r\n<p>p&uacute;blico alvo da etapa atual:<br>popula&ccedil;&atilde;o geral com comob de 12 a 17 anos de idade.</p>\r\n<p><em>Enviado pela secretaria municipal de sa&uacute;de.</em></p>'),
